        //send http request get to backend /time
        fetch("/time", {
                            method: 'GET',
                            mode: 'cors',
                            cache: 'no-cache',
                            credentials: 'same-origin',
                            headers: {
                                'Content-Type': 'application/json'
                            },
                            redirect: 'follow',
                            referrerPolicy: 'no-referrer'
                       }).then(
            //parse json response
            res => res.json()
        ).then(
            //write into var
            data => {
                setData(data)
                //print to console
                console.log(data)
            }
        )
    //empty array to only fetch once []
    }, [])




